import React, { Component } from "react";
import data from "./data";

const socialMediaList = data.SocialMedias;
console.log(data.SocialMedias);

class Example1 extends Component {
  render() {
    return (
      <ul>
        {socialMediaList.map(s => (
          <li>{s}</li>
        ))}
      </ul>
    );
  }
}
export default Example1;
